      fetch('http://localhost:8080/member1')
        .then(response => console.log(response))
        .then(data => console.log(data))
        .catch(error => console.error('Error fetching data:', error));
    }, []);

    return(
      <>
      </>
    )
    
    
}
    
    
export default Main;
